import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Button from "./Button.js";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      display: "test",
    };
  }

  render() {
    return (
      <div id="container">
        <div id="display">{this.state.display}</div>
        <Button />
      </div>
    );
  }
}
export default App;
